DeleteFileSystem.syncDocumentation:
/**<p> Deletes a file system, permanently severing access to its contents. Upon return, the file system no longer exists and you will not be able to access any contents of the deleted file system. </p> <p> You cannot delete a file system that is in use. That is, if the file system has any mount targets, you must first delete them. For more information, see <a>DescribeMountTargets</a> and <a>DeleteMountTarget</a>. </p> <note>The <code>DeleteFileSystem</code> call returns while the file system state is still "deleting". You can check the file system deletion status by calling the <a>DescribeFileSystems</a> API, which returns a list of file systems in your account. If you pass file system ID or creation token for the deleted file system, the <a>DescribeFileSystems</a> will return a 404 "FileSystemNotFound" error.</note> <p>This operation requires permission for the <code>elasticfilesystem:DeleteFileSystem</code> action.</p>
@param deleteFileSystemRequest 
@throws BadRequestException Returned if the request is malformed or contains an error such as an invalid parameter value or a missing required parameter.
@throws InternalServerErrorException Returned if an error occurred on the server side.
@throws FileSystemNotFoundException Returned if the specified <code>FileSystemId</code> does not exist in the requester's AWS account.
@throws FileSystemInUseException Returned if a file system has mount targets.*/

