DeleteMountTarget.syncDocumentation:
/**<p>Deletes the specified mount target. </p> <p> This operation forcibly breaks any mounts of the file system via the mount target being deleted, which might disrupt instances or applications using those mounts. To avoid applications getting cut off abruptly, you might consider unmounting any mounts of the mount target, if feasible. The operation also deletes the associated network interface. Uncommitted writes may be lost, but breaking a mount target using this operation does not corrupt the file system itself. The file system you created remains. You can mount an EC2 instance in your VPC using another mount target. </p> <p> This operation requires permission for the following action on the file system: </p> <ul> <li> <code>elasticfilesystem:DeleteMountTarget</code> </li> </ul> <note>The <code>DeleteMountTarget</code> call returns while the mount target state is still "deleting". You can check the mount target deletion by calling the <a>DescribeMountTargets</a> API, which returns a list of mount target descriptions for the given file system. </note> <p>The operation also requires permission for the following Amazon EC2 action on the mount target's network interface:</p> <ul> <li> <code>ec2:DeleteNetworkInterface</code> </li> </ul>
@param deleteMountTargetRequest 
@throws BadRequestException Returned if the request is malformed or contains an error such as an invalid parameter value or a missing required parameter.
@throws InternalServerErrorException Returned if an error occurred on the server side.
@throws DependencyTimeoutException The service timed out trying to fulfill the request, and the client should try the call again.
